css:
.editor-colors {
  background-color: #fff;
  color: #333;
}
.editor .invisible-character,
.editor .wrap-guide,
.editor .indent-guide,
.editor .invisible {
  color: rgba(85, 85, 85, 0.08);
}
.editor .gutter {
  color: #998;
  background: #fff;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: rgba(226, 67, 0, 0.41);
}
.editor.is-focused .selection .region {
  background-color: #afc4da;
}
.editor.is-focused .cursor {
  border-color: #333;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: rgba(255, 255, 134, 0.34);
}
.comment {
  font-style: italic;
  color: #cfcfc1;
}
.comment.yard {
  color: #998;
}
.string .punctuation.section.embedded,
.string .punctuation.section.embedded .source,
.string {
  color: #df5000;
}
.string .meta.embedded.line,
.string .source {
  color: #333;
}
.constant.other.symbol,
.constant.numeric {
  color: #945277;
}
.constant.language {
  color: #333;
  font-weight: bold;
}
.constant.character,
.constant.other {
  color: #094e99;
}
.variable {
  color: #008080;
}
.variable.parameter,
.variable.other.block,
.variable.punctuation.separator,
.variable.other.object > .punctuation {
  color: #333;
}
.keyword,
.keyword.special-method {
  color: #333;
}
.keyword.operator {
  color: #333;
  font-weight: bold;
}
.keyword.unit {
  color: #945277;
  font-weight: bold;
}
.keyword.control,
.keyword.other {
  font-weight: bold;
}
.storage.modifier .storage.type,
.storage {
  font-weight: bold;
}
.entity.name.function {
  font-weight: bold;
  color: #945277;
}
.entity.name.class {
  color: #458;
  font-weight: bold;
}
.entity.other.attribute-name {
  font-weight: bold;
  color: #458;
}
.entity.other.inherited-class {
  font-weight: normal;
  color: #094e99;
}
.entity.other.inherited-class .punctuation {
  color: #333;
}
.support.function.builtin {
  font-weight: bold;
}
.support.class {
  color: #094e99;
}
.support.constant,
.support.function,
.support.type {
  color: #333;
}
.markup.deleted {
  background-color: #fdd;
  color: #faa;
}
.invalid {
  background-color: #fdd;
  color: #faa;
}
.invalid.deprecated {
  color: #fff3ac;
  background-color: #fbf7cd;
}
.meta.structure.dictionary.json > .string.quoted.double.json,
.meta.structure.dictionary.json > .string.quoted.double.json .punctuation.string {
  color: #458;
}
.meta.structure.dictionary.value.json > .string.quoted.double.json,
.meta.structure.dictionary.value.json > .string.quoted.double.json > .punctuation {
  color: #df5000;
}
.meta.diff,
.meta.diff.header {
  color: #75715E;
}
.css.keyword,
.less.keyword,
.scss.keyword {
  font-weight: bold;
}
.css.support.property-name,
.less.support.property-name,
.scss.support.property-name {
  color: #008080;
}
.css.constant,
.less.constant,
.scss.constant {
  color: #099;
}
.css.meta.selector,
.less.meta.selector,
.scss.meta.selector {
  color: #458;
  font-weight: bold;
}
.css.support.property-value,
.less.support.property-value,
.scss.support.property-value,
.css.constant.other.rgb-value,
.less.constant.other.rgb-value,
.scss.constant.other.rgb-value,
.css.constant.numeric,
.less.constant.numeric,
.scss.constant.numeric {
  color: #945277;
}
.css.support.function,
.less.support.function,
.scss.support.function {
  color: #945277;
  font-weight: bold;
}
.js.type.function {
  font-weight: bold;
}
.ruby.storage.modifier .ruby.storage.type,
.ruby.storage {
  color: #333;
}
.bracket-matcher {
  border-bottom: 0 none;
  background-color: #c9c9c9;
  opacity: 0.6;
}
